const Card = (props) => {
    return (
        <div className="pb-3 col-3 text-center px-0" style={{overflow: "hidden"}}>
            <div className="rounded-card">
                <div className="card-img">
                    <img src={props.cardImage} className={'rounded w-50'}/>
                </div>
            </div>

        </div>
    )
};


export default Card;
